import React from 'react';
import Header from '../components/header';
import WelcomeSection from '../components/banner';
import CardSection from '../components/cards';
import Footer from '../components/footer';

const Home = () => {
  return (
    <div>
      <Header />
      <WelcomeSection />
      <CardSection />
      <Footer />
    </div>
  );
};

export default Home;
